static void fwriteStrEscapedMaxNumChars(int f, const char* c) {
    static const int N = 60;
    char buffer[N+5];
    char* t = buffer;
    int numChars = 0;
    while (numChars < N && c != '\0') {
        *t++ = *c++;
        numChars++;
    }
    if (c != '\0') {
        *t++ = '.';
        *t++ = '.';
        *t++ = '.';
    }
    *t++ = '\0';
    fwriteStrEscaped(f, buffer);
}

